import styled from "styled-components/native";

export const LocationText = styled.Text`
  padding: 10px 15px;
  font-size: 18px;
  color: #fff;
`;

export const DetailOrderNumber = styled.Text`
  color: #fff;
  font-size: 24px;
`;

export const Seperator = styled.View`
  border: 1px solid #4e4e4e;
  margin: 15px 0;
`;
